script: |
  super -f text -I q344.spq | sort > q344.out

inputs:
  - name: q344.spq
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab1 (FORMAT parquet) WHERE - col1 + + + 29 + + ( + 33 ) * 19 BETWEEN + CAST ( - col2 AS INTEGER ) AND + col1;
  - name: tab1

outputs:
  - name: q344.out
    data: |
